	results["flowAgreementEnabled"] = selectValue(params.flowParameters.isTermsOfServiceEnabled, params.ciam_agreementEnabled);

	// Check whether Protect Analysis is required or not
	results["flowProtectAnalysisRequired"] = selectValue(params.flowParameters.isProtectAnalysisRequired, params.ciam_protectAnalysisRequired);

	// Allowed device types: Initially allowing all device types
    const devices = [];
    devices.push("EMAIL", "FIDO2", "SMS", "TOTP", "VOICE", "MOBILE");

	results["flowAllowedDeviceTypes"] = devices.join(",");

	return { ...results };
}

